      <p>This is the blog post content.</p>
    </div>
));

const Content = withRouter(props => (
    <div>
      <h1>{props.router.query.title}</h1>
      <p>This is the blog post content.</p>
    </div>
));

const Post = withRouter( (props) => {
    return (
        <Layout>
            <h1>{props.router.query.title}</h1>
            <p> This is a blog post</p>
            <ContentRouter/>
        </Layout>
    );
}
);

export default Post;
